import Header from './todolist/header'
import Addtodo from './todolist/Addtodo'
import Todolist from './todolist/Todolist'
import reducer from './todolist/reducer'
import Login from './todolist/Login'

import React from 'react'
import { createStore } from 'redux'
import { Provider } from 'react-redux'
import { BrowserRouter, Switch, Route } from 'react-router-dom'

const sty = {
  textAlign: 'center', margin: "70px", backgroundColor: "darkgrey", width: "40%", marginLeft: '24%', border: '4px solid black'
}
const state = {
  userDetails: [],
  deleted: []
}

const store = createStore(reducer, state)

export default class App extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <Provider store={store}>
        <BrowserRouter>
          <div style={sty}>
            <Header />
            <Switch>
              <Route exact path='/' component={Login} />
              <Route path='/add' component={Addtodo} />
              <Route path='/lists' component={Todolist} />
              <Todolist />
            </Switch>
          </div>
        </BrowserRouter>
      </Provider>
    )
  }
}
